import {getCountryData} from '../../lib/countries'; 
import Title from '../../components/Title'; 

export default function Post({countryData}) {
    return (
        <Title country={countryData.name} emoji={countryData.emoji}/>
    )
}

export async function getStaticProps({ params }) {
    const country = getCountryData(params.country); 

    return {
        props: {
            countryData: country
        }
    }
}
